import { useEffect, useState } from "react";
import { getWorkspaces, getPrograms, getMembers } from "../api/api";
import StatCard from "../components/StatCard";

export default function Dashboard() {
  const [stats, setStats] = useState({});

  useEffect(() => {
    Promise.all([getWorkspaces(), getPrograms(), getMembers()])
      .then(([w, p, m]) =>
        setStats({
          workspaces: w.length,
          programs: p.length,
          members: m.length
        })
      );
  }, []);

  return (
    <>
      <h1>Enterprise Dashboard</h1>
      <div className="stats">
        <StatCard title="Workspaces" value={stats.workspaces} />
        <StatCard title="Programs" value={stats.programs} />
        <StatCard title="Members" value={stats.members} />
      </div>
    </>
  );
}
